%[text] ## Load all Segmentation metadata
%[text] The slicer Segmentation table contains the names of the segmentations, so its good to load all the names to ensure the data formats match. 
paths.folder = fullfile(matlabdrive,"ANAT6205_Dropbox","Femurs"); % note the use of a wild card in the file name
paths.fileWC = '*.seg.nrrd'; % wild card file name to load just segmentation files
[segT,contentT] = mmGetAllSlicerSegTables(fullfile(paths.folder, paths.fileWC)) %[output:61d1f170] %[output:97d4138f]
%%
summary(segT) %[output:8df11d96]
%[text] - review Volume Dimensions (a dimension of 4 indicates a slicer segmentation with layers) \
%%
summary(contentT) %[output:087b3bf9]
%%
%[text] #### Review last name and segment counts in table
groupsummary(segT,"LastName","mode","VolumeDimensions") % find the volumes with too many dimensions %[output:6d96a79c]
%%
%[text] Remove volumes with wrong dimensions from analysis
la = contentT.VolDim == 4;
contentT(la,:) = []; 
%%
%[text] ### Review Segmentation names
groupsummary(segT,"SegName") %[output:7848bcb5]
%[text] - look for inconsistencies in the names of segmentations (e.g. capitalization issues, etc. ) \
%[text] 
