%[text] ### Compare Femur lengths
%[text] The right femurs in this dataset were all from the same dataset and were automatically generated by TotalSegmentator. So they should be all be identical, correct?
%[text] Let's get some region properties on these femurs
RP  = getFemurLength(contentT) %[output:48e44f97] %[output:2738f41b] %[output:408349ce]
